import { CgHeart } from 'react-icons/cg';
import styled from '@emotion/styled';
export const HeartBtn = styled(CgHeart)`
  position: absolute;
  top: 14px;
  right: 14px;
  width: 18px;
  height: 18px;

  color: rgba(255, 255, 255, 0.8)
  transition: all 250ms cubic-bezier(0.4, 0, 0.2, 1);
  cursor: pointer;
`;
